import React from "react";
import PropTypes from "prop-types";
// function Food(props) { 아래와 같다
function Food({ name, picture, rating }) {
    return (
        <div>
            <h1> i like {name}</h1>;<h4>{rating}/5.0</h4>
            <img src={picture} alt={name} />
        </div>
    );
}
//id 를 추가하지 않면, 각각의 child 가 unique 캐릭터를 가지고 있지 않다고 뜸
const foodILike = [
    {
        id: 1,
        name: "kimchi",
        image: "data:image/jpeg;base64,",
        rating: 5,
    },
    {
        id: 2,
        name: "samgyeopsal",
        image: "data:image/jpeg;base64,",
        rating: 4,
    },
    {
        id: 3,
        name: "bibimbap",
        image: "data:image/jpeg;base64,",
        rating: 4.9,
    },
];

Food.propTypes = {
    name: PropTypes.string.isRequired,
    picture: PropTypes.string.isRequired,
    // rating: PropTypes.string.isRequired, //ㅇ렇게 하면 오류
    rating: PropTypes.number.isRequired, //이렇게 하면 성공
};

function App() {
    return (
        <div>
            {foodILike.map((dish) => (
                <Food
                    key={dish.id}
                    name={dish.name}
                    picture={dish.image}
                    rating={dish.rating}
                />
            ))}
            {/* <Food
                fav="kimchi" */}
            {/* // something={true}
                // papapa={[`hello`, 1, 2, 3, 4, 5]}
            /> */}
            {/* <Food fav="ramen" />
            <Food fav="samgyeopsal" />
            <Food fav="jjugume" /> */}
        </div>
    );
}

export default App;
